import { Image } from "@chakra-ui/image";
import { Box, Flex, Link, Stack } from "@chakra-ui/layout";
import { Drawer, DrawerBody, DrawerCloseButton, DrawerContent, DrawerOverlay } from "@chakra-ui/modal";
import { VFC } from "react";
import { FaWrench, FaRegCommentDots, FaHome, FaWalking, FaRegHandshake } from "react-icons/fa";

type Props = {
    onClose: () => void;
    isOpen: boolean;
}

export const MenuDrawer: VFC<Props> = (props) => {
    const {onClose, isOpen} = props;

    return (
        <Drawer placement="left" onClose={onClose} isOpen={isOpen} variant="outline">
            <DrawerOverlay>
                <DrawerContent>
                    <DrawerBody>
                        <Box p={4} borderBottom="4px" borderColor="gray.300" textAlign="center">
                            <Image boxSize="150px" borderRadius="full" m="auto" src="https://source.unsplash.com/random" alt=""/>
                            <Box mt={6}>
                                <Link fontSize="3xl" fontWeight="bold">Text</Link>
                            </Box>
                        </Box>
                        <Box>
                            <Stack>
                                <Flex>
                                    <FaHome size={24} />
                                    <Link ml={2} onClick={() => {
                                        onClose();
                                    }}>Home</Link>
                                </Flex>
                                <Flex>
                                    <FaRegHandshake size={24} />
                                    <Link ml={2} onClick={() => {
                                        onClose();
                                    }}>Tweet</Link>
                                </Flex>
                                <Flex>
                                    <FaWrench size={24}/>
                                    <Link ml={2} onClick={() => {
                                        onClose();
                                    }}>Setting</Link>
                                </Flex>
                                <Flex>
                                    <FaWalking size={24} />
                                    <Link ml={2} onClick={() => {
                                        onClose();
                                    }}>Logout</Link>
                                </Flex>
                            </Stack>
                        </Box>
                    </DrawerBody>
                    <DrawerCloseButton />
                </DrawerContent>
            </DrawerOverlay>
        </Drawer>
    );
};
